    public void test11() {
        List<Map> maplist = new ArrayList<>();
        for (int i = 0; i < 10; i++) {
            Map m = new HashMap<>();
            m.put("id", "id" + i);
            m.put("name", "name" + i);
            m.put("sex", "1");
            maplist.add(m);
        }
        final List<String> fields = new ArrayList<>();
        fields.add("id");
        fields.add("name");
        maplist.stream().map(x -> retainField(x, fields)).forEach(x -> {
            x.keySet().stream().sorted().forEach(c -> System.out.println(c + ":" + x.get(c)));
        });
    }

    public Map retainField(Map m, List<String> fields) {
        Map m2 = new HashMap();
        fields.forEach(c -> m2.put(c, m.get(c)));
        return m2;
    }


