    public void pailie(Stack<Integer> stack, int cengshu) {
        for (int k = 1; k <= 3; k++) {
            if (!stack.contains(k)) {
                stack.add(k);
                if (cengshu == 3) {
                    stack.stream().forEach(System.out::print);
                    System.out.println("\n");
                } else {
                    pailie(stack, cengshu + 1);
                }
                stack.pop();
            }
        }
    }


